    // Solidity code for a crowdfunding contract
    pragma solidity ^0.8.0;

    contract Crowdfunding {
        address public creator;
        uint256 public goalAmount;
        uint256 public deadline;
        mapping(address => uint256) public contributions;

        constructor(uint256 _goalAmount, uint256 _deadline) {
            creator = msg.sender;
            goalAmount = _goalAmount;
            deadline = _deadline;
        }

        function contribute() public payable {
            require(block.timestamp < deadline, "Campaign is over");
            contributions[msg.sender] += msg.value;
        }

        function claimFunds() public {
            require(address(this).balance >= goalAmount, "Funding goal not reached");
            require(msg.sender == creator, "Only creator can claim funds");
            payable(creator).transfer(address(this).balance);
        }

        function refund() public {
            require(block.timestamp >= deadline && address(this).balance < goalAmount, "Cannot refund");
            payable(msg.sender).transfer(contributions[msg.sender]);
            contributions[msg.sender] = 0;
        }
    }
