    // Solidity code for subscription-based payments
    pragma solidity ^0.8.0;

    contract SubscriptionPayment {
        address public serviceProvider;
        mapping(address => uint256) public subscriptions;

        constructor() {
            serviceProvider = msg.sender;
        }

        function subscribe(uint256 amount) public {
            // Users can subscribe by paying an amount
            subscriptions[msg.sender] += amount;
        }

        function charge(address subscriber, uint256 amount) public {
            require(msg.sender == serviceProvider, "Only the service provider can charge");
            require(subscriptions[subscriber] >= amount, "Not enough balance to charge");
            subscriptions[subscriber] -= amount;
        }
    }
